using System.Collections.Generic;
using System.Linq;

namespace pwiz.Skyline.Model.Esp
{
    /// <summary>
    /// This class mostly translates the AADB feature coefficient file from the Supplementary
    /// Source Code section of the original ESP paper into a C# class to avoid load-time parsing.
    /// </summary>
    public class EspFeatureDb
    {
        public static double CalculateFeature(FeatureDef feature, string seq)
        {
            double[] coeffs = GetCoefficients(feature);
            char[] aas = seq.Where(c => !double.IsNaN(coeffs[AminoAcid.ToIndex(c)])).ToArray();
            return aas.Sum(c => coeffs[AminoAcid.ToIndex(c)]) / aas.Length;            
        }

        public static string GetFeatureName(FeatureDef feature)
        {
            return GetFeatureName(GetFeatureIndex(feature));
        }

        public static string GetFeatureName(int featureIndex)
        {
            return ESP_COEFFS[featureIndex].Key;
        }

        public static double[] GetCoefficients(FeatureDef feature)
        {
            return GetCoefficients(GetFeatureIndex(feature));
        }

        public static double[] GetCoefficients(int featureIndex)
        {
            return ESP_COEFFS[featureIndex].Value;
        }

        public static int GetFeatureIndex(FeatureDef feature)
        {
            return (int)feature - (int)FeatureDef.AVG_Average_volumes_of_residues_Pontius_et_al_1996;
        }

        public static FeatureDef GetFeatureDef(int featureIndex)
        {
            return FeatureDef.AVG_Average_volumes_of_residues_Pontius_et_al_1996 + featureIndex;
        }

        public static int CountFeatures
        {
            get { return ESP_COEFFS.Length; }
        }

        public static IEnumerable<FeatureDef> AllFeatures
        {
            get
            {
                for (int i = 0; i < (int) FeatureDef.count; i++)
                    yield return (FeatureDef) i;
            }
        }

        static EspFeatureDb()
        {
            for (int i = 0; i < ESP_COEFFS.Length; i++)
                ESP_COEFFS[i] = Init(ESP_COEFFS[i]);
        }

        private static KeyValuePair<string, double[]> Init(KeyValuePair<string, double[]> namedCoeffs)
        {
            double[] rawCoeffs = namedCoeffs.Value;
            double[] newCoeffs = new double[26];
            for (int i = 0; i < rawCoeffs.Length; i++)
            {
                newCoeffs[AminoAcid.ToIndex(ESP_COEFF_AAS[i])] = rawCoeffs[i];
            }
            return new KeyValuePair<string, double[]>(namedCoeffs.Key, newCoeffs);
        }


